import React from "react";

function DeleteQuizPopup() {
  return (
    <div
      style={{
        height: "35vh",
        width: "57vw",
        marginTop: "30vh",
        marginLeft: "3vw",
        backgroundColor: "pink",
        borderRadius: "10px",
      }}
    >
      <p
        style={{
          fontSize: "2.5em",
          fontWeight: "600",
          color: "#474444",
          textAlign: "center",
          paddingTop: "2vh",
        }}
      >
        <p>Are you confirm you</p>
        <p> want to delete ?</p>
      </p>

      <div
        style={{
          display: "flex",
          marginLeft: "6vw",
          marginTop: "8vh",
          gap: "5vw",
          marginRight: "3vw",
        }}
      >
        <button style={{ height: "6vh", width: "20vw", borderRadius: "10px" }}>
          Confirm Delete
        </button>
        <button style={{ height: "6vh", width: "20vw", borderRadius: "10px" }}>Cancel</button>
      </div>
    </div>
  );
}

export default DeleteQuizPopup;
